import React from 'react';
import axios from 'axios';

const apiCall = () => {
  axios.get('http://localhost:8080').then((data) => {
    console.log(data)
  })
}

export const SignUpPage = () => (
    <div className='signup'>
      <button onClick={apiCall}>Make API Call</button>
    </div>
  );

export default SignUpPage;
